// Function for MATLAB Function: '<S29>/NLMPC'
int32_T full_loopModelClass::full_loo_ComputeNumDependentEq_
  (s_3RW6EhlAOINzvAvYfuaanB_full_T *qrmanager, const real_T beqf_data[], int32_T
   mConstr, int32_T nVar)
{
  int32_T numDependent;
  boolean_T exitg1;
  numDependent = mConstr - nVar;
  if (0 > numDependent) {
    numDependent = 0;
  }

  full_loop_B.b_idx = 0;
  while (full_loop_B.b_idx <= nVar - 1) {
    qrmanager->jpvt.data[full_loop_B.b_idx] = 0;
    full_loop_B.b_idx++;
  }

  full_loop_factorQRE_n(qrmanager, mConstr, nVar);
  full_loop_B.tol = 100.0 * static_cast<real_T>(nVar) * 2.2204460492503131E-16;
  if (nVar < mConstr) {
    full_loop_B.b_idx = nVar;
  } else {
    full_loop_B.b_idx = mConstr;
  }

  while ((full_loop_B.b_idx > 0) && (fabs(qrmanager->QR.data[((full_loop_B.b_idx
             - 1) * qrmanager->QR.size[0] + full_loop_B.b_idx) - 1]) <
          full_loop_B.tol)) {
    full_loop_B.b_idx--;
    numDependent++;
  }

  if (numDependent > 0) {
    full_loop_computeQ_(qrmanager, qrmanager->mrows);
    full_loop_B.b_idx = 0;
    exitg1 = false;
    while ((!exitg1) && (full_loop_B.b_idx <= numDependent - 1)) {
      full_loop_B.qtb = 0.0;
      full_loop_B.ix_e = ((mConstr - full_loop_B.b_idx) - 1) * qrmanager->ldq;
      full_loop_B.iy = 0;
      full_loop_B.k_eh = 0;
      while (full_loop_B.k_eh <= mConstr - 1) {
        full_loop_B.qtb += qrmanager->Q.data[full_loop_B.ix_e] *
          beqf_data[full_loop_B.iy];
        full_loop_B.ix_e++;
        full_loop_B.iy++;
        full_loop_B.k_eh++;
      }

      if (fabs(full_loop_B.qtb) >= full_loop_B.tol) {
        numDependent = -1;
        exitg1 = true;
      } else {
        full_loop_B.b_idx++;
      }
    }
  }

  return numDependent;
}

